- input: "TEXT\x1CC00417550\x1CX0\x1C\x1CF3A\x1CReport is amended to note that the
    contributions from political organizations that are not registered with the Federal
    Election Commission have confirmed that the contributions were made with permissable
    funds.  Also, the contributions received after the date of the primary have been
    corrected to note that the election designation was General.  A software error
    led to the erroneous reporting of those contributions as being designated for
    the Primary.   The contributions which were disclosed as having been forwarded
    to the New York League of Conservation Voters, with the Committee acting as a
    conduit, have been corrected to note that the contributions were in fact earmarked
    and received via the League.  Finally, the excessive contribution amount from
    Michael Royce was refunded on 1/25/13.\n"
